import React from 'react';
import './nav_bar.css';

export default class Navbar extends React.Component{


  render(){
      return(
         <div className = "navbar">
             <ul>
                  <li>Home</li>
                  <li>Objectives</li>
                  <li>Activities</li>
                  <li>Events</li>
                  <li>Membership</li>
                  <li>Organization</li>
                  <li>Contact</li>
                  <li><img className = 'lang_sel'src = {require('../images/de.png')} alt = 'Lang_Deutsch'/> </li>
                  <li>History</li>
             </ul>

         </div>

      )

  }  

}
